import { makeStyles } from '@material-ui/core';
import React from 'react';
import SeeMore from './SeeMore';
import './../css/fonts.css';

const useStyles = makeStyles(()=>({
    list:{
        width:'200px',
        height:'250px',
        display:'flex',
        flexDirection:'column',
        border:'2px solid #D1C19A',
        outline:'none',
    },
    titleList:{
        fontWeight:'bold',
        borderBottom:'3px solid #D1C19A',
        margin:'20px auto 0',
        fontSize:'25px'

    },
    contName:{
        width:'100%',
        display:'flex',
        justifyContent:'center',
        alignItems:'center',
        margin: '25px 0 20px'
    },
    pillar:{
        height:'3px',
        width:'48px',
        background:'#D1C19A'
    },
    nameList:{
        width:'100px',
        height:'100px',
        border:'3px solid #331212',
        display:'flex',
        justifyContent:'center',
        alignItems:'center'
    },
    buttonContainer:{
        margin:'0px auto'
    }

}));

const List = () => {
  const classes = useStyles();
  return (
    
      <button className={classes.list}>
          <div className={classes.titleList}>Lista</div>
          
          <div className={classes.contName}>
            <div className={classes.pillar}></div>
            <div className={classes.nameList}>1</div>
            <div className={classes.pillar}></div>
          </div>
          
          <div className={classes.buttonContainer}>
            <SeeMore />
          </div>
      </button>
    
  );
}

export default List;
